import React, { useEffect, useRef } from 'react';
import { gsap } from 'gsap';

interface ThreeDModelProps {
  className?: string;
}

export default function ThreeDModel({ className = '' }: ThreeDModelProps) {
  const containerRef = useRef<HTMLDivElement>(null);
  const capsulesRef = useRef<HTMLDivElement[]>([]);

  useEffect(() => {
    if (!containerRef.current || capsulesRef.current.length === 0) return;

    // Animate capsules on mount with GSAP
    const tl = gsap.timeline({ defaults: { ease: 'power2.out' } });

    capsulesRef.current.forEach((capsule, index) => {
      // Set initial state
      gsap.set(capsule, {
        opacity: 0,
        rotationY: -30,
        rotationX: 20,
        scale: 0.8,
        transformOrigin: 'center center',
      });

      // Animate in with stagger
      tl.to(
        capsule,
        {
          opacity: 1,
          rotationY: 0,
          rotationX: 0,
          scale: 1,
          duration: 1.2,
          delay: index * 0.1,
        },
        index * 0.08
      );
    });

    // Continuous subtle animation
    capsulesRef.current.forEach((capsule, index) => {
      gsap.to(capsule, {
        y: Math.sin(index) * 5,
        rotationZ: Math.sin(index) * 2,
        duration: 3 + index * 0.3,
        repeat: -1,
        yoyo: true,
        ease: 'sine.inOut',
        delay: index * 0.2,
      });
    });

    // Mouse interaction
    const handleMouseMove = (e: MouseEvent) => {
      if (!containerRef.current) return;
      const rect = containerRef.current.getBoundingClientRect();
      const x = (e.clientX - rect.left) / rect.width;
      const y = (e.clientY - rect.top) / rect.height;

      capsulesRef.current.forEach((capsule, index) => {
        const offset = index * 0.5;
        gsap.to(capsule, {
          rotationY: (x - 0.5) * 20 + offset,
          rotationX: -(y - 0.5) * 15,
          duration: 1,
          ease: 'power2.out',
        });
      });
    };

    containerRef.current.addEventListener('mousemove', handleMouseMove);

    return () => {
      containerRef.current?.removeEventListener('mousemove', handleMouseMove);
    };
  }, []);

  // Create 7 capsules arranged in a fan pattern
  const capsuleCount = 7;
  const centerAngle = -90; // Start from bottom
  const angleSpread = 120; // Spread of 120 degrees
  const radius = 120;

  const capsules = Array.from({ length: capsuleCount }, (_, i) => {
    const angle = centerAngle + (angleSpread / (capsuleCount - 1)) * i;
    const radian = (angle * Math.PI) / 180;
    const x = Math.cos(radian) * radius;
    const y = Math.sin(radian) * radius;
    const rotation = angle + 90; // Rotate capsule to align with fan direction

    return { x, y, rotation, index: i };
  });

  return (
    <div
      ref={containerRef}
      className={`relative w-full h-full flex items-center justify-center ${className}`}
      style={{
        perspective: '1000px',
        perspectiveOrigin: 'center center',
      }}
    >
      <div
        className="relative"
        style={{
          width: '400px',
          height: '400px',
          transformStyle: 'preserve-3d',
        }}
      >
        {capsules.map((capsule, index) => (
          <div
            key={index}
            ref={(el) => {
              if (el) capsulesRef.current[index] = el;
            }}
            className="absolute"
            style={{
              left: '50%',
              top: '50%',
              transform: `translate(-50%, -50%) translate3d(${capsule.x}px, ${capsule.y}px, 0) rotateZ(${capsule.rotation}deg)`,
              transformStyle: 'preserve-3d',
            }}
          >
            {/* 3D Capsule */}
            <div
              className="relative"
              style={{
                width: '50px',
                height: '180px',
                transformStyle: 'preserve-3d',
              }}
            >
              {/* Main body with gradient */}
              <div
                style={{
                  width: '50px',
                  height: '180px',
                  borderRadius: '25px',
                  background: `linear-gradient(to bottom, 
                    rgba(255, 255, 255, 0.95) 0%, 
                    rgba(255, 255, 255, 0.9) 15%,
                    rgba(147, 197, 253, 0.8) 40%,
                    rgba(59, 130, 246, 0.9) 50%,
                    rgba(37, 99, 235, 0.85) 60%,
                    rgba(147, 197, 253, 0.8) 85%,
                    rgba(255, 255, 255, 0.95) 100%
                  )`,
                  boxShadow: `
                    0 8px 16px rgba(0, 0, 0, 0.15),
                    0 4px 8px rgba(0, 0, 0, 0.1),
                    inset -10px 0 20px rgba(255, 255, 255, 0.3),
                    inset 10px 0 20px rgba(0, 0, 0, 0.1)
                  `,
                  border: '1px solid rgba(255, 255, 255, 0.3)',
                  position: 'relative',
                  overflow: 'hidden',
                }}
              >
                {/* Specular highlight */}
                <div
                  style={{
                    position: 'absolute',
                    left: '10%',
                    top: '10%',
                    width: '30%',
                    height: '80%',
                    background: 'linear-gradient(to right, rgba(255, 255, 255, 0.6), transparent)',
                    borderRadius: '25px',
                    filter: 'blur(8px)',
                  }}
                />
                
                {/* Inner glow */}
                <div
                  style={{
                    position: 'absolute',
                    left: '50%',
                    top: '20%',
                    transform: 'translateX(-50%)',
                    width: '60%',
                    height: '60%',
                    background: 'radial-gradient(ellipse, rgba(255, 255, 255, 0.4), transparent)',
                    borderRadius: '50%',
                  }}
                />
              </div>

              {/* Shadow underneath */}
              <div
                style={{
                  position: 'absolute',
                  left: '50%',
                  top: '100%',
                  transform: 'translateX(-50%)',
                  width: '40px',
                  height: '8px',
                  background: 'radial-gradient(ellipse, rgba(0, 0, 0, 0.2), transparent)',
                  borderRadius: '50%',
                  filter: 'blur(6px)',
                }}
              />
            </div>
          </div>
        ))}
      </div>

      <style>{`
        @keyframes float {
          0%, 100% {
            transform: translateY(0px);
          }
          50% {
            transform: translateY(-10px);
          }
        }
      `}</style>
    </div>
  );
}
